After running the first step of CYK on the prefix “t4 t8” (positions 1–2), you find

  pos 1 “t4” ⇒ {NT1, NT4, NT18, NT27, NT30}  
  pos 2 “t8” ⇒ {NT10, NT31}

and there is no binary rule of the form A→B C with B∈{1,4,18,27,30} and C∈{10,31}.  Hence cell(1,2) stays empty and no larger span can cover the string. 

Therefore the string is not in L(G).  
No

After running a quick CYK‐style check on the first two terminals t1 t5, we find

  pos 1 “t1” ⇒ {NT27, NT20}  
  pos 2 “t5” ⇒ {NT11, NT19, NT2}  

No binary rule in the grammar has any of the right‐hand sides (NT27,NT11), (NT27,NT19), (NT27,NT2), (NT20,NT11), (NT20,NT19) or (NT20,NT2).  Hence the span covering positions 1–2 is never filled by any nonterminal, so no derivation can cover the whole string.  
No
